          const { site_name, vendor_name, month } = item;

          return (
            mainOrderList.includes(site_name) &&
            mainOrderList.includes(vendor_name) &&
            mainOrderList.includes(month)
          );
        });

  }, []);

  return (
    <div>
      
    </div>
  );
};

export default MainOrderComponent;
